import React from "react";

const TableHeader = () => {
  return (
    <thead>
      <tr>
        <th>Summary</th>
        <th>Priority</th>
        <th>Created On</th>
        <th>Due Date</th>
        <th>Actions</th>
      </tr>
    </thead>
  );
};

export default TableHeader;
